import React from 'react';
import './commentBox.css';

const commentBox = (props) => {
    return ( 
        <div className={'CommentBox'}>
            <div className={'CommentPhrase'}>{props.content[2]}</div>
            <div className={'CommentPhrase'}>{props.content[1]}</div>
            <div className={'CommentPhrase'}>{props.content[0]}</div>
        </div>
     );
}

export default commentBox;
